import React, { useState } from "react";

const AIPanel = ({ data }) => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className="ai-panel py-6 px-20 max-w-3xl w-full mx-auto space-y-4 bg-white rounded-xl shadow-lg relative">
      <h1 className="text-xl font-bold mb-4">AI Predictions Panel</h1>
      {/* Main Dropdown */}
      <div className="prediction-panel bg-gray-100 p-4 rounded-lg shadow-md">
        <div
          className="flex justify-between items-center cursor-pointer"
          onClick={() => setIsOpen(!isOpen)}
        >
          <h3 className="text-lg font-bold">
            Class: {data?.predictions?.[0]?.class || "Unknown"}
          </h3>
          <button className="text-gray-500">{isOpen ? "▲" : "▼"}</button>
        </div>

        {/* Expandable Section with Fixed Height */}
        <div
          className={`mt-3 overflow-hidden transition-all duration-300 ${
            isOpen ? "max-h-[500px] opacity-100" : "max-h-0 opacity-0"
          }`}
          style={{
            transitionProperty: "max-height, opacity",
            height: isOpen ? "auto" : "0",
          }}
        >
          {data?.predictions?.map((prediction, index) => (
            <div
              key={index}
              className="bg-white p-3 mb-2 rounded-lg shadow-md border border-gray-200"
            >
              <h4 className="font-semibold text-sm">Prediction {index + 1}</h4>
              <p className="text-sm">
                <strong>X:</strong> {prediction.x}
              </p>
              <p className="text-sm">
                <strong>Y:</strong> {prediction.y}
              </p>
              <p className="text-sm">
                <strong>Confidence:</strong>{" "}
                {Math.round(prediction.confidence * 100)}%
              </p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default AIPanel;
